const User = () => {

  return (
    <div>
      <h1>Your MERN Stack App</h1>
      <div>
        {/* Button to Create Ticket */}
        <Link to="/create-ticket">
          <button>Create Ticket</button>
        </Link>
      </div>

      <div>
        {/* Button to View Tickets */}
        <Link to="/view-ticket">
          <button>View Tickets</button>
        </Link>
      </div>
    </div>
  );
};

export default User;
